import React from "react";

class Password extends React.Component {
    constructor (props) {
        super(props);
        this.state = {
            mostraPass: 'password'
        }
    }
    render() {
        return (
            <div>
                <hr/>
                <label>Password</label>
                <input type='password' />
                <button>Mostrar</button>
            </div>
        )
    }
}

export default Password
